import React from 'react';
import Header from './Header.js'
import Emergency from './Emergency.js'
import Schedule from './Schedule.js'
import { BrowserRouter, Route, Switch } from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
    <div className = "App">
      <Header />
      <h1>"Hello"</h1>
      <Switch>
        {/* <Route exact path = '/'>
          <Home />
        </Route> */}
        <Route path = '/Emergency'>
          <Emergency />
        </Route>
        <Route>
          <Schedule />
        </Route>
        </Switch>
    </div>
    </BrowserRouter>

  );
}

export default App;
